}

import {Jwt} from './jwt';


export var auth = {
    Jwt: Jwt
};

import {Authentication} from './authentication';


export class Jwt extends Authentication {
    constructor() {
        super();
    }

    /**
     * Type of the Authentication
     *
     * @returns {string}
     */
    static type() {
        return 'jwt';
    }

    /**
     * Get formatted authentication headers
     *
     * @returns {object}
     */
    get headers() {
        let headers = {
            'x-access-token': this.token
        };

        return headers;
    }

    /**
     * Set authentication token value
     *
     * @param {string} - JWT Token value
     */
    set token(token) {
        this.authData = token;
    }

    /**
     * Get authentication token value
     *
     * @returns {string}
     */
    get token() {
        return this.authData;
    }
}

import {apis} from './apis';


export class Sdk {
    /**
     * Initialize Ingresse API's SDK
     *
     * @param {object} [settings] - SDK configuration settings
     */
    constructor(settings = {}) {
        this._init(settings);
    }

    /**
     * Sdk Version
     *
     * @return {string}
     */
    static version() {
        return '{{version}}';
    }

    /**
     * Initialize API's configurations
     *
     * @param {object} settings - SDK settings.
     */
    _init(settings = {}) {
        let list = settings.apis || Object.keys(apis);

        list.map((key) => {
            let Api = apis[key];

            if (Api) {
                let options = settings[key] || null;
                this[key]   = new Api(options);
            }
        });
    }
}

import {auth} from './auth';
import * as axios from 'axios';


export class RequestHandler {
    /**
     * Initialize request handler
     *
     * @param {object} settings - Settings
     */
    constructor(settings = {}) {
        this.baseURL = settings.url;
        this._configAuth(settings.auth);
    }

    /**
     * Initialize Authentication
     * The default authentication method is JWT.
     *
     * @private
     * @param {string} method - Authentication method.
     */
    _configAuth(method) {
        switch(method) {
            default:
                this._auth = new auth.Jwt();
                break;
        }
    }

    /**
     * Get API request headers
     *
     * @returns {object}
     */
    get headers() {
        let headers = {
            'User-Agent': 'Ingresse JS SDK',
        };

        if (this._auth) {
            headers.auth = this._auth.headers;
        }

        return headers;
    }

    /**
     * Create new request promise
     *
     * @private
     * @param {object} options - request options.
     *
     * @return {Promise}
     */
    request(options = {}) {
        let def = {
            baseURL: this.baseURL,
            headers: this.headers,
            json   : true,
        };

        let request = Object.assign({}, def, options);

        return axios(request);
    }

    /**
     * Get resource
     *
     * @param {string} resource - Get endpoint e.g. /api-path/1
     * @param {object} [params] - Optional request parameters.
     *
     * @return {Promise}
     */
    get(resource, params) {
        let request = {
            method: 'GET',
            url   : resource,
            params: params,
        };

        return this.request(request);
    }

    /**
     * Post resource
     *
     * @param {string} resource - Resource endpoint e.g. /api-path
     * @param {object} data     - Data to be posted.
     * @param {object} [params] - Optional request parameters.
     *
     * @returns {Promise}
     */
    post(resource, data, params) {
        let request = {
            method: 'POST',
            url   : resource,
            data  : data,
            params: params,
        };

        return this.request(request);
    }

    /**
     * Put resource
     *
     * @param {string} resource - Resource endpoint
     * @param {object} data - Data to be updated.
     * @param {object} [params] - Optional request parameters.
     *
     * @returns {Promise}
     */
    put(resource, data, params) {
        let request = {
            method: 'PUT',
            url   : resource,
            data  : data,
            params: params,
        };

        return this.request(request);
    }

    /**
     * Delete resource
     *
     * @param {string} resource - Resource endpoint
     * @param {object} [params] - Optional request parameters.
     *
     * @returns {Promise}
     */
    delete(resource, params) {
        let request = {
            method: 'DELETE',
            url   : resource,
            params: params,
        };

        return this.request(request);
    }
}
